<?php

namespace Tests\Feature\Ray;

use App\Models\User;
use Tests\TestCase;

/**
 * Code has been copied from Service
 * Need it for easy navigate during presentation at Web Artisans Meet-up
 *
 * Class RayPHPServiceTest
 * @package Tests\Unit\Ray
 */
class RayPHPServiceTest extends TestCase
{
    /**
     * Measure time of execution
     *
     * @test
     */
    public function measure(): void
    {
        ray()->measure();
        sleep(1);
        ray()->measure();
    }

    /**
     * Display the table in ray app
     *
     * @test
     */
    public function table(): void
    {
        ray()->table([
            'Pierwszy wierszy' => 'Pierwsza wartość',
            'Drugi wierszy' => 'Druga wartość',
            'Trzeci wierszy' => 'Trzecia wartość',
        ]);

        // User as table
        ray()->table(User::first()->toArray());
    }

    /**
     * Conditional display
     *
     * @test
     */
    public function conditional(): void
    {
        ray('Pokaże się w ray')->showIf(true);
        ray('Nie pokaże się w ray')->showIf(false);
    }


    /**
     * Display information about PHP
     *
     * @test
     */
    public function phpinfo()
    {
        ray()->phpinfo();
        ray()->phpinfo('memory_limit', 'default_mimetype');
    }

    /**
     * Render html
     *
     * @test
     */
    public function html()
    {
        ray()->html('<strong style="color:#f00;">Simple html</strong>');

        $blade = view('welcome');
        ray()->html($blade);
    }

    /**
     * Display image in ray app
     *
     * @test
     */
    public function image()
    {
        // Display image from url
        // Source: https://www.wykop.pl/wpis/31337505/przedstawiam-wam-nowa-konwencje-programistyczna-mo/
        ray()->image('https://www.wykop.pl/cdn/c3201142/comment_BJOXu12yg4rNx2uyidwYxnNPGiXD07hT.jpg');

        // Display base64-encoded image
        ray()->image('');
    }
}
